import React, { useState } from 'react';
import './App.css';
import Breadcrumb from './Breadcrumb';
import CategoryPage from './CategoryPage';
import { categories, Category } from './data/categories';

const App: React.FC = () => {
  const [path, setPath] = useState<Category[]>([]);

  const handleNavigate = (category: Category) => {
	setPath([...path, category]);
  };

  const handleBreadcrumbClick = (index: number) => {
	setPath(path.slice(0, index + 1));
  };

  const handleReset = () => {
	setPath([]); // Reset the path to the top of the category list
  };

  const currentCategory: Category = path.length
	? path[path.length - 1]
	: { name: 'Home', subcategories: categories };

  const displayText = path.length
	? path.map(category => category.name).join(' > ')
	: 'A Guide to WWW';

  return (
	<div className="app">
	  <div className="header">
		<div className="navbar">
		  <button>Back</button>
		  <button>Forward</button>
		  <button>Home</button>
		  <button>Reload</button>
		  <button>Images</button>
		  <button>Open</button>
		  <button>Print</button>
		  <button>Find</button>
		  <button>Stop</button>
		</div>
		<div className="search-bar">
		  <input type="text" placeholder="Search" />
		</div>
	  </div>
	  <div className="main-content">
		<h1>
		  <a href="#" onClick={handleReset}>Alien</a> - {displayText}
		</h1>
		<Breadcrumb path={path} onClick={handleBreadcrumbClick} />
		<div className="sub-links">
		  [
		  <a href="#">What's New?</a> | 
		  <a href="#">What's Cool?</a> | 
		  <a href="#">What's Popular?</a> | 
		  <a href="#">Stats</a> | 
		  <a href="#">A Random Link</a>]
		</div>
		<img src="/menu.gif" alt="Menu" className="menu" />
		<CategoryPage
		  category={currentCategory}
		  onNavigate={handleNavigate}
		/>
		<div className="footer">
		  <b>23836</b> entries in <i>Alien</i> | <a href="#"><i>Alien</i></a> | <a href="#"><i>Up</i></a> | <a href="#"><i>Search</i></a> | <a href="#"><i>Mail</i></a> | <a href="#"><i>Add</i></a> | <a href="#"><i>Help</i></a>
		  <p><a href="mailto:">[email protected]</a></p>
		  <p>Copyright © 1994 Antimeme and Bias Research Ltd.</p>
		</div>
	  </div>
	</div>
  );
};

export default App;
